INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2111, 25553, 'Quinidine', 'In a small, randomized, crossover study, the administration of quinidine with grapefruit juice (compared to water) to healthy volunteers significantly prolonged the time to reach peak plasma quinidine concentrations and decreased the plasma concentrations of its major metabolite, 3-hydroxyquinidine.  These changes were associated pharmacodynamically with both a delay and a reduction in the maximal effect on QTc interval.  The proposed mechanism is delay of gastric emptying as well as inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall induced by certain compounds present in grapefruits.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'789c4d8e4b0ec2300c05aff2766c10d7e01c56e2b646a913ecb8d0db93565db07c1f8de6291b2bfac2c816f3cda164563f4763d438ba248866feded1a80b6b771827964d74c63b44258bf2f5dfe14b8d92415b957c6253558fb575a98a3a613ea893850c0e69fecb7885a401aa68c643aa8f7d47680ec65422f5a003e24307ad90af742aa38c73f1c70f00874c19', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2112, 27447, 'Azilsartan medoxomil', 'Many psychotherapeutic and CNS-active agents (e.g., anxiolytics, sedatives, hypnotics, antidepressants, antipsychotics, opioids, alcohol, muscle relaxants) exhibit hypotensive effects, especially during initiation of therapy and dose escalation.  Coadministration with antihypertensives and other hypotensive agents, in particular vasodilators and alpha-blockers, may result in additive effects on blood pressure and orthostasis.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2113, 27448, 'Azilsartan medoxomil', 'Many psychotherapeutic and CNS-active agents (e.g., anxiolytics, sedatives, hypnotics, antidepressants, antipsychotics, opioids, alcohol, muscle relaxants) exhibit hypotensive effects, especially during initiation of therapy and dose escalation.  Coadministration with antihypertensives and other hypotensive agents, in particular vasodilators and alpha-blockers, may result in additive effects on blood pressure and orthostasis.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2115, 20209, 'Quinine', 'Coadministration with grapefruit juice does not appear to affect the pharmacokinetics of quinine in a clinically relevant manner.  Although grapefruit juice is an inhibitor of CYP450 3A4 and quinine is metabolized by this pathway to its major metabolite, 3-hydroxyquinine, a study of ten healthy volunteers found no significant differences in quinine peak plasma concentration (Cmax), time to reach Cmax (Tmax), terminal elimination half-life, systemic exposure (AUC), or apparent oral clearance (Cl/F) when a single 600 mg oral dose of quinine sulfate was administered in combination with 200 mL of orange juice (control), half-strength grapefruit juice, and full-strength grapefruit juice twice daily for 6 days each, separated by a 2-week washout period.  Relative to the control period, the apparent renal clearance of quinine was markedly increased by 81% during treatment with half-strength grapefruit juice.  However, since renal clearance accounts for approximately 6% of the total clearance of quinine, this change would likely have minimal clinical impact.  The lack of a significant interaction is probably due to the fact that grapefruit juice primarily inhibits intestinal rather than hepatic CYP450 3A4, and quinine is not known to undergo significant presystemic metabolism as evidenced by its relatively high oral bioavailability (76% to 88%).  Nevertheless, excessive consumption of grapefruit juice and tonic water (which contains quinine) was suspected as the cause of torsade de pointes arrhythmia in a patient with a history of asymptomatic long QT syndrome.  Treatment with magnesium sulfate and metoprolol had no effect, but the arrhythmia resolved spontaneously 48 hours after discontinuation of the drinks.', 'food', 'Minor', '', 'DDInter', 0, X'789c0dccdb1183300c04c056ae800c45a41361cb44104b8e1e1f741f0ad87d537087295ab9b3263a25bd30adb353320ea7c5c34b1267496334d3a8b9521e2381e5b6d3febd113418c31cf9614c3acd256fd8c0a294270e245da2077e252acadb1feb3f2dae', NULL, X'');
