INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2193, 9647, 'Rasagiline', 'Foods that contain large amounts of tyramine may precipitate a hypertensive crisis in patients treated with monoamine oxidase (MAO) inhibitors.  The mechanism involves inhibition of MAO-A, the enzyme responsible for metabolizing exogenous amines such as tyramine in the gut and preventing them from being absorbed intact.  Once absorbed, tyramine is metabolized to octopamine, a substance that is believed to displace norepinephrine from storage granules.', 'Tyrosine-rich foods', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
